function Sidebar() {
  return (
    <div className="col-lg-2">
      <button type="button" class="btn btn-primary">
        New Questions
      </button>
      <ul class="list-group">
        <li class="list-group-item border-0">Politics</li>
        <li class="list-group-item border-0">Sports</li>
        <li class="list-group-item border-0">Movies</li>
        <li class="list-group-item border-0">History</li>
        <li class="list-group-item border-0">Geography</li>
      </ul>
    </div>
  );
}

export default Sidebar;
